// src/components/WorkoutPlanner/WorkoutPlannerForm.js

import React, { useState } from 'react';
import axios from 'axios';

const WorkoutPlannerForm = () => {
  const [formData, setFormData] = useState({
    name: '',
    age: '',
    gender: '',
    height: '',
    weight: '',
    occupation: '',
    experience_level: 'Beginner'
  });

  const [workoutPlan, setWorkoutPlan] = useState(null);
  const [error, setError] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setLoading(true);

    const data = new FormData();
    Object.keys(formData).forEach((key) => {
      data.append(key, formData[key]);
    });

    axios.post('http://localhost:8000/generate_workout_plan', data, {
      headers: {
        'Content-Type': 'multipart/form-data',
      },
    })
      .then((response) => {
        setLoading(false);
        if (response.data.error) {
          setError(response.data.error);
          setWorkoutPlan(null);
        } else {
          setWorkoutPlan(response.data.plan);
          setError(null);
        }
      })
      .catch((error) => {
        setLoading(false);
        if (error.response?.data?.error) {
          setError(error.response.data.error);
        } else {
          setError('An error occurred. Please try again.');
        }
        setWorkoutPlan(null);
      });
  };

  return (
    <div>
      {!workoutPlan && !loading ? (
        <form onSubmit={handleSubmit} style={{ padding: '1rem', maxWidth: '500px' }}>
          <div style={{ marginBottom: '1rem' }}>
            <label style={{ display: 'block', fontWeight: 'bold' }}>Name:</label>
            <input
              type="text"
              name="name"
              required
              value={formData.name}
              onChange={handleChange}
              placeholder="Enter your name"
              style={{ width: '100%', padding: '0.5rem' }}
            />
          </div>

          <div style={{ marginBottom: '1rem' }}>
            <label style={{ display: 'block', fontWeight: 'bold' }}>Age:</label>
            <input
              type="number"
              name="age"
              required
              value={formData.age}
              onChange={handleChange}
              placeholder="e.g. 30"
              style={{ width: '100%', padding: '0.5rem' }}
            />
          </div>

          <div style={{ marginBottom: '1rem' }}>
            <label style={{ display: 'block', fontWeight: 'bold' }}>Gender:</label>
            <select
              name="gender"
              required
              value={formData.gender}
              onChange={handleChange}
              style={{ width: '100%', padding: '0.5rem' }}
            >
              <option value="">Select gender</option>
              <option value="M">Male</option>
              <option value="F">Female</option>
            </select>
          </div>

          <div style={{ marginBottom: '1rem' }}>
            <label style={{ display: 'block', fontWeight: 'bold' }}>Height (cm):</label>
            <input
              type="number"
              name="height"
              required
              value={formData.height}
              onChange={handleChange}
              placeholder="e.g. 175"
              style={{ width: '100%', padding: '0.5rem' }}
            />
          </div>

          <div style={{ marginBottom: '1rem' }}>
            <label style={{ display: 'block', fontWeight: 'bold' }}>Weight (kg):</label>
            <input
              type="number"
              name="weight"
              required
              value={formData.weight}
              onChange={handleChange}
              placeholder="e.g. 70"
              style={{ width: '100%', padding: '0.5rem' }}
            />
          </div>

          <div style={{ marginBottom: '1rem' }}>
            <label style={{ display: 'block', fontWeight: 'bold' }}>Occupation:</label>
            <input
              type="text"
              name="occupation"
              required
              value={formData.occupation}
              onChange={handleChange}
              placeholder="e.g. Software Developer"
              style={{ width: '100%', padding: '0.5rem' }}
            />
          </div>

          <div style={{ marginBottom: '1rem' }}>
            <label style={{ display: 'block', fontWeight: 'bold' }}>Experience Level:</label>
            <select
              name="experience_level"
              required
              value={formData.experience_level}
              onChange={handleChange}
              style={{ width: '100%', padding: '0.5rem' }}
            >
              <option value="Beginner">Beginner</option>
              <option value="Intermediate">Intermediate</option>
              <option value="Advanced">Advanced</option>
            </select>
          </div>

          <button 
            type="submit" 
            style={{ 
              padding: '0.8rem 1.2rem',
              backgroundColor: '#007bff',
              color: 'white',
              border: 'none',
              borderRadius: '4px',
              cursor: 'pointer'
            }}
          >
            Generate Workout Plan
          </button>
        </form>
      ) : loading ? (
        <p>Loading...</p>
      ) : (
        <div style={{ marginTop: '1rem' }}>
          <h1>Your Workout Plan</h1>
          <div className="workout-plan-container" style={{
            border: '1px solid #ccc',
            padding: '1rem',
            borderRadius: '8px',
            marginTop: '1rem'
          }}>
            {Object.entries(workoutPlan).map(([day, exercises]) => (
              <div key={day} style={{ marginBottom: '1rem' }}>
                <h2 style={{ marginBottom: '0.5rem' }}>{day}</h2>
                <ul style={{ paddingLeft: '1.2rem' }}>
                  {exercises.map((ex, i) => (
                    <li key={i} style={{ marginBottom: '0.25rem' }}>
                      {typeof ex === 'object'
                        ? Object.entries(ex).map(([key, value]) => (
                            <div key={key}>{key}: {value}</div>
                          ))
                        : ex
                      }
                    </li>
                  ))}
                </ul>
              </div>
            ))}
          </div>

          <button 
            onClick={() => setWorkoutPlan(null)} 
            style={{ 
              marginTop: '1rem',
              padding: '0.8rem 1.2rem',
              backgroundColor: '#6c757d',
              color: 'white',
              border: 'none',
              borderRadius: '4px',
              cursor: 'pointer'
            }}
          >
            Create New Plan
          </button>
        </div>
      )}

      {error && (
        <div style={{ 
          color: 'red', 
          marginTop: '1rem',
          padding: '1rem',
          backgroundColor: '#ffe6e6',
          borderRadius: '4px'
        }}>
          {error}
        </div>
      )}
    </div>
  );
};

export default WorkoutPlannerForm;
